    return (
        <HomepageContainer>
            <Profiler id="Directoy" onRender={(id, phase, actualDuration) => {
                console.log({ id, phase, actualDuration });
            }}>
                <Directory />
            </Profiler>
        </HomepageContainer>
    )
}

export default Homepage
